import { QUERY_PROJECTS } from "../../utils/queries";
import { useQuery } from "@apollo/client";
import { ExploreContainer } from "./Common.js";
import { Link } from "react-router-dom";
import Earth from ""

function ExploreCard(props) {
  const { loading, data } = useQuery(QUERY_PROJECTS);
  const projects = data?.projects || [];

  console.log(data);

  return (
    <ExploreContainer>
      {projects.map((projects) => (
        <div key={projects._id} className="explore__card">
          <div className="explore__card__author">
            <h4 className="project__author">
              @{projects.projectAuthor}
            </h4>
            <h4 className="post__time">
              {projects.createdAt}
            </h4>
          </div>
          <div className="explore__image">
            <img src={earth}/>
          </div>
          <div className="explore__card__title">
            <h3 className="project__title">
              <Link to={`/projects/${projects._id}`}>
                {projects.projectTitle}
              </Link>
            </h3>
          </div>
        </div>
      ))}
    </ExploreContainer>
  );
}

export default ExploreCard;
